import PropTypes from 'prop-types'
import { Container, Paper, Table, TableCell, TableContainer, TableHead, TableRow } from '@mui/material'
import React, { Component, useEffect, useState } from 'react'
import axios from 'axios'
const [loading, setLoading] = useState(true);
  const [data, setData] = useState([])


export class ListaPropostas extends Component {
  static propTypes = {}


  render() {
    useEffect(()=>{
        const fetchData = async () =>{
            setLoading(true);
            try{
                const {data: resposne} = await axios.get('localhost:8001');
                setData(resposne);
            }catch (erro){
                console.error(erro.message);

            }
            setLoading(false);
        }
        fetchData();

    }, [])
    return (
      <div>ListaPropostas</div>
    )
  }
}

export default ListaPropostas
